    const { onChange, data: { id, description, done } } = props;



    return (
        <div>
                <input
                    className="todo__state"
                    name={id}
                    type="checkbox"
                    defaultChecked={done}
                    onChange={onChange}
                />
                <div>
                    {description}</div>
        </div>
    )
}

